import React from 'react';
//Components
import Header from './components/Header'
import Footer from './components/Footer'
import HomeScreen from './components/screens/HomeScreen'

//Style
import {Container} from 'react-bootstrap'
import './App.css';


function App() {
  return (
  <>
    <Header/>
    <main className='py-3'>
    <Container>
      <h1>Welcome</h1>
    </Container>
      </main>
    <Footer/>
  </>  
  );
}

export default App;
